import React from "react";
import Entry from "/Entry.jsx"


function createEntry(Emoji)
{
  emoji=Emoji.emoji,
  name=Emoji.name,
  meaning=Emoji.meaning
}


function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">


      {emojipedia.map(createEntry)}


      </dl>
    </div>
  );
}

export default App;
